import styled from "styled-components";

export const Head = styled.header`
  color: red;
  border:1px solid red;
  display:flex;
  justify-content:space-between;
  align-items:center;
  padding:20px;
`;
export const Logo = styled.a`
  color: red;
  border:1px solid red;
  height:50px;
  width:280px;
  & img{
    border:1px solid red;
    height:100%;
    width:100%;
    object-fit:contain
  }
`;
